import React, { useEffect, useState } from 'react';
import Navbar from '../../components/navbar/NavbarFreelancer';
import axios from 'axios';
import styles from './Profile.module.css';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogTitle from '@material-ui/core/DialogTitle';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';

const ProfileFreelancer = () => {
  const [profileData, setProfileData] = useState({});
  const [error, setError] = useState('');
  const [isEditing, setIsEditing] = useState(false);
  const [jobProfile, setJobProfile] = useState('');
  const [portfolio, setPortfolio] = useState('');
  const [expectedPaygrade, setExpectedPaygrade] = useState('');
  const [previousJobs, setPreviousJobs] = useState('');
    
  const handleCompleteProfileClick = () => {
    setIsEditing(true);
  };

  const handleFormSubmit = async (event) => {
    event.preventDefault();
    const userId = localStorage.getItem('_id');
    try {
      const token = sessionStorage.getItem('token');
      const response = await axios.put(
        `http://localhost:8001/profile/update/${userId}`,
        { jobProfile, portfolio, expectedPaygrade, previousJobs },
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        },

        { withCredentials: true }
      );
      if (response.data.success) {
        setIsEditing(false);
        // Refresh profile data
      } else {
        console.error("Server response error:", response.data);
      }
    } catch (error) {
      console.error("Failed to update profile data", error);
    }
  };

  
  useEffect(() => {
    const fetchProfileData = async () => {
      const userId = localStorage.getItem('_id');
      try {
        const token = sessionStorage.getItem('token');
        const { data } = await axios.get(
          `http://localhost:8001/profile/getprofile/${userId}`,
          {
            headers: {
              Authorization: `Bearer ${token}`,
            },
          },
          { withCredentials: true }
        );
  
        const { success, profile } = data;
        if (success) {
          setProfileData(profile);
        } else {
          setError("Failed to fetch profile data");
          console.error("Server response error:", data);
        }
      } catch (error) {
        setError("Failed to fetch profile data");
        console.log(error);
      }
    };
  
    fetchProfileData();
  }, []);

  return (
    <>
      <Navbar />
      <div className={styles.container}>
        {error && <p>{error}</p>}
        {profileData && (
          <div className={styles.profileSection}>
            <img
              src={profileData && profileData.profileImage ? `http://localhost:8001/${profileData.profileImage.replace(/\\/g, '/')}` : ''}
              alt="Profile"
              className={styles.profilePhoto}
            />
            <div className={styles.profileDetails}>
              <p>Name: {profileData.username}</p>
              <p>Email: {profileData && profileData.userId && profileData.userId.email}</p>
              <p>Contact: {profileData.contact}</p>
              <p>About You: {profileData.description}</p>
              <p>Job Profile:{profileData.jobProfile} </p>
              <p>Portfolio: {profileData.portfolio}</p> 
              <p>Expected Paygrade: {profileData.expectedPaygrade}</p>
              <p>Previous Jobs: {profileData.previousJobs}</p>
              

            {isEditing ? (
              <Dialog open={isEditing} onClose={() => setIsEditing(false)}>
                <DialogTitle>Complete Profile</DialogTitle>
                <form onSubmit={handleFormSubmit}>
                  <DialogContent>
                    <TextField
                      autoFocus
                      margin="dense"
                      label="Job Profile"
                      type="text"
                      fullWidth
                      value={jobProfile}
                      onChange={e => setJobProfile(e.target.value)}
                    />
                    <TextField
                      margin="dense"
                      label="Portfolio"
                      type="text"
                      fullWidth
                      value={portfolio}
                      onChange={e => setPortfolio(e.target.value)}
                    />
                    <TextField
                      margin="dense"
                      label="Expected Paygrade"
                      type="text"
                      fullWidth
                      value={expectedPaygrade}
                      onChange={e => setExpectedPaygrade(e.target.value)}
                    />
                    <TextField
                      margin="dense"
                      label="Previous Jobs"
                      type="text"
                      fullWidth
                      value={previousJobs}
                      onChange={e => setPreviousJobs(e.target.value)}
                    />
                  </DialogContent>
                  <DialogActions>
                    <Button onClick={() => setIsEditing(false)} color="primary">
                      Cancel
                    </Button>
                    <Button type="submit" color="primary">
                      Submit
                    </Button>
                  </DialogActions>
                </form>
              </Dialog>
            ) : (
              <Button variant="outlined" color="primary" onClick={handleCompleteProfileClick}>
                Complete Profile
              </Button>
            )}
            </div> 
          </div>
        )}
      </div>
    </>
  );
}


export default ProfileFreelancer;
